import React, { useState } from 'react';

class Manufacturer {
  constructor(companyName, location, panNum, entity, govtB, gstNum) {
    this.companyName = companyName;
    this.location = location;
    this.panNum = panNum;
    this.entity = entity;
    this.govtB = govtB;
    this.gstNum = gstNum;
  }
}

const gst_validate = () => {
  const [showSignIn, setShowSignIn] = useState(true);
  const [allManufacturers, setAllManufacturers] = useState([]);

  const sign_up_btn_clicked = () => {
    setShowSignIn(false);
  };

  const sign_in_btn_clicked = () => {
    setShowSignIn(true);
  };

  const getDetails = (event) => {
    event.preventDefault();
    const form = event.target;
    const company_name = form.elements['company_name'].value;
    const location = form.elements['location'].value;
    const pan_number = form.elements['pan_number'].value;
    const no_of_entity = form.elements['no_of_entity'].value;
    const govt = form.elements['govt'].value;
    const gst_num = form.elements['gst_num'].value;

    // Validation logic
    let isValid = true;
    // Perform your validation checks here and set isValid accordingly

    if (isValid) {
      const newManufacturer = new Manufacturer(company_name, location, pan_number, no_of_entity, govt, gst_num);
      setAllManufacturers([...allManufacturers, newManufacturer]);
      alert('Details are verified and successfully registered');
      form.reset();
    } else {
      alert('Failed to Register : Incorrect Details');
    }
  };

  const login = (event) => {
    event.preventDefault();
    const form = event.target;
    const username = form.elements['username'].value;
    const password = form.elements['password'].value;

    // Validation logic
    let isValid = true;
    // Perform your validation checks here and set isValid accordingly

    if (isValid) {
      // Perform login/authentication logic here
      alert('Login successful!');
      form.reset();
    } else {
      alert('Invalid username or password');
    }
  };

  return (
    <div id="container">
      <div id="buttons">
        <button id="sign_in_button" onClick={sign_in_btn_clicked}>
          Sign-in
        </button>
        <button id="sign_up_button" onClick={sign_up_btn_clicked}>
          Sign-Up
        </button>
      </div>
      {showSignIn ? (
        <div id="sign-in">
          <form id="log_in" onSubmit={login}>
            <h2 id="sign_in">SIGN-IN</h2>
            <label htmlFor="username">Username</label>
            <input type="text" id="username" placeholder="Username" required />
            <label htmlFor="password">Password</label>
            <input type="password" id="password" placeholder="Password" required />
            <input type="submit" value="Log-in" style={{ marginTop: '5px', marginBottom: '5px' }} />
          </form>
        </div>
      ) : (
        <div id="sign-up">
          <form id="register_details" onSubmit={getDetails}>
            <h2 id="sign_up_head">SIGN-UP</h2>
            <label htmlFor="company_name">Company Name</label>
            <input type="text" id="company_name" placeholder="Company Name" required />
            <label htmlFor="location">State Location</label>
            <select id="location" required>
              {/* Add options for states here */}
            </select>
            <label htmlFor="pan_number">PAN Number</label>
            <input type="text" id="pan_number" placeholder="PAN Number" required />
            <label htmlFor="no_of_entity">Number of Entities with the same PAN number</label>
            <input type="text" id="no_of_entity" placeholder="Number of Entities" required />
            <label htmlFor="govt">Does your org belong to Govt. bodies?</label>
            <select id="govt">
              <option value="No">No</option>
              <option value="Yes">Yes</option>
            </select>
            <label htmlFor="gst_num">GST Number</label>
            <input type="text" id="gst_num" placeholder="GST Number" required />
            <input type="submit" value="Register" />
          </form>
        </div>
      )}
    </div>
  );
};

export default gst_validate;
